package syntaxtree;import visitor.BuildSymbolTableVisitor;import visitor.Visitor;import visitor.TypeVisitor;public class IdentifierType extends Type {  public String s;  public IdentifierType() {}  public IdentifierType(String as, Position p) {    s=as;position=p;  }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }    public Type accept(BuildSymbolTableVisitor v){	  return new IdentifierType();    }      public String toString() {  	  return s;  }}